import React from 'react';
import styled from "styled-components";

function Work() {
  return (
    <Container>
          
          <h4>NEW TO DISNEY +</h4>
          <Content>
                { movies && movies.map((movie,key)=>(
                    <Wrap key={key} >
                        
                        <Link to={`/detail/` + movie.id}>
                            <img src={movie.cardImg} alt={movie.title} />
                        </Link>
                    </Wrap>
                ))}
           </Content>
        </Container>
  )
}

export default Work
